import styled from 'styled-components';

export const CollectionPreview = styled.div`
  margin-left: auto;
  margin-right: auto;
  color: #555;
  font-weight: 400;
  @media screen and (max-width: 800px) {
    margin-left: 0px;
    margin-right: 0px;
   }
`;
